textOriginal:
真會胡説八道，以前民進黨立委砍國民黨政府預算，國民黨都沒説什麼,現在國民黨砍民進黨政府之一些應酬交際業務費，一間小辦公視，一次要花費一二百萬元，這樣的胡亂花錢不用刪嗎
民進黨集體貪汚舞弊案，如前瞻計畫，光電，爐渣，疫苗，雞蛋等等等好幾兆淘空國庫的貪汚舞弊案，賴皮寮總統賴清德說民進黨上述的集體貪汚淘空國庫舞弊案,國會如果要調閱資料轍查，就是國會擴權，違法，違憲，行政院窒礙難行，而一般人民違法，公務人員貪汚，立即移送法辦，民進黨政府說是遵循法律程序，符合公平義原則，
@禪-f3y  傲視全球的全民健康保險是國民黨八十三年開辦，護國神山台積電也是國民黨孫運璿,李國鼎，趙耀東等等幾十位老前輩經過了近二十年的努力下才能成立台積電,
可是民進黨執政後就開始貪汚舞弊蔡英文當選總統後更是花台灣人民新苦繳納的稅金，專養網軍,     批評,監視在野黨,,反對黨，顛倒是非,不說人話，
全世界的民主國家，經過了幾百年都找不到像民進黨那可惡的政黨，前嘉義縣長張花冠違犯政府採購法，將八年縣長期間，幾十件評選委員的名單洩漏給廠商，金額高達近百億，如果是一般公務人員只要一件就要判五年以上有起徒刑,而張花冠鐵政如山的幾十件近百億的貪汚案件卻只判一年十個月有期徒刑，還可易科罰金，真是見鬼了，柯文哲根本查不到真正的犯罪事實，因政治追殺，要判28年半，這就是在民進黨執正下恐佈政府,
全民一定要團結，用選票轍底消滅,無惡不做的民進黨，民進黨街頭遊行,所設計的政治活動,及發動罷免活動，都是違法動用人民辛苦繳納的稅金,   立委高金素梅就查出民進黨政府違法動用編列預算的經費,提供民進黨政治活動,  光查到就有上億元，還沒查到不知還有多少，所以全民一定要轍查民進黨這次罷免活動，又要違法動用人民辛苦繳納多少的稅金，全民一定要轍底查清楚,一定要用選票消滅集體貪汚舞弊,成立一個詐騙集團的政府,
@peggychen2819  我看你真的是不認識字，立委高金素梅在立法院已查出證據民進黨政府違法將勞工安定基金及農業部補助農民的補助快款用於民進黨政府用於民進黨罷免在野黨的政治活動,並且高金素梅將證據在立法院當場質詢勞動部長及農業部長他們兩人均無言以對，不知所措，連行政院長卓榮泰都不敢替部長回話，
